import numpy as np
import pandas as pd
from scipy import stats
from sklearn.metrics import confusion_matrix, classification_report, roc_curve
from sklearn.metrics import ConfusionMatrixDisplay
from sklearn.model_selection import train_test_split
import matplotlib.pyplot as plt


def roda_modelo(modelo):
    # Fix: Pass x_treino as features and y_treino as the target
    # Assuming y_treino is your target variable
    modelo.fit(x_treino, y_treino)

    prob_predic = modelo.predict_proba(x_teste)

    print(f'\n------------------------Resultados {modelo} ------------------------\n')

    data_bom = np.sort(modelo.predict_proba(x_teste)[:, 0])
    data_mau = np.sort(modelo.predict_proba(x_teste)[:, 1])
    kstest = stats.ks_2samp(data_bom, data_mau)

    print(f'Métrica KS: {kstest}')

    print('\n Confusion Matrix \n')

    # Fix: Use ConfusionMatrixDisplay to plot the matrix
    # predict using x_teste first
    predicao = modelo.predict(x_teste)
    cm = confusion_matrix(y_teste, predicao, normalize='true') # y_teste and predicao are passed as positional arguments

    # Create the figure and axes first
    fig, ax = plt.subplots(figsize=(7, 7))

    # then use ConfusionMatrixDisplay and specify the axes
    disp = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=['Bom-pagador', 'Mau-pagador'])
    disp.plot(cmap=plt.cm.Blues, ax=ax)

    # The rest of the plotting code remains the same
    ax.set_title('\n Matriz de confusão Normalizada \n', fontsize=16, fontweight='bold')
    ax.set_xlabel('Label predita', fontsize=18)
    ax.set_ylabel('Label real', fontsize=14)
    plt.grid(False)
    plt.show()

    print('\n Classification Report \n')
    print(classification_report(y_teste, predicao, zero_division=0))

    print('\n ROC curve \n')
    # Fix: Pass y_teste and probabilities for the positive class
    # removed 'modelo' as the first argument here
    fpr, tpr, thresholds = roc_curve(y_teste, modelo.predict_proba(x_teste)[:, 1])
    plt.plot(fpr, tpr)
    plt.xlabel('False Positive Rate')
    plt.ylabel('True Positive Rate')
    plt.title('ROC Curve')
    plt.show()

